import fetch from "node-fetch";
import { UPLOAD_DATA } from "../actionType/actionType"

export const fetchData = async () => {
    try {
        let data = await fetch('https://opentdb.com/api.php?amount=10&category=10&difficulty=medium&type=multiple')
        console.log(data)
    } catch (err) {
        console.error(err)
    }



}
